/*
 * Copyright (C) 2018-2022 David C. Harrison. All right reserved.
 *
 * You may not use, distribute, publish, or modify this code without
 * the express written permission of the copyright holder.
 */

import './App.css';
import React from 'react';
// import {useState, useEffect, useCallback} from 'react';
import {
  Typography, CssBaseline, AppBar, Toolbar,
  Button, Box, Stack, IconButton,
  // Typography, AppBar, Toolbar, CssBaseline,
  // Drawer, Box, Divider,
  // IconButton, Button,
  // ListItem, ListItemButton, ListItemIcon, ListItemText,
  // Table, TableBody, TableCell, TableContainer,
  // TableHead, TableRow, Paper,
} from '@mui/material/';
import {ThemeProvider, createTheme} from '@mui/material/styles';
// import {deepPurple, pink} from '@mui/material/colors';
import image from './media/portrait.jpg';
import homeImage from './media/home.jpg';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import EmailIcon from '@mui/icons-material/Email';
// import MenuIcon from '@mui/icons-material/Menu';
// import InboxIcon from '@mui/icons-material/Inbox';
// import MailIcon from '@mui/icons-material/Mail';
// import ClearIcon from '@mui/icons-material/Clear';

const styles = {
  paperContainer: {
    backgroundImage: `url(${homeImage})`,
    backgroundRepeat: 'no-repeat',
  },
};

const theme = createTheme({
  palette: {
    background: {
      default: '#ACA2C4',
    },
    primary: {
      main: '#FE99A1',
    },
    secondary: {
      main: '#FE99A1',
    },
    tertiary: {
      main: '#FFFFFF',
    },
    quaternary: {
      main: '#9A91AF',
    },
  },
  typography: {
    fontFamily: [
      'Roboto',
      'Montserrat',
      'merriweather',
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      'Roboto',
      '"Helvetica Neue"',
      'Arial',
      'sans-serif',
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
    ].join(','),
    button: {
      textTransform: 'none',
    },
  },
});

/**
 * Returns app component
 * @return {object}
 */
function App() {
  return (
    <>
      <ThemeProvider theme={theme}>
        <CssBaseline/>
        <AppBar position="static"
          style={{background: 'transparent'}}
        >
          <Toolbar>
            <Box
              display="flex"
              justifyContent="center"
              alignItems="center"
              flex={1}
            >
              <Button sx={{fontSize: 18}} component="label" color="tertiary">
                Home
              </Button>
              <Button sx={{fontSize: 18}} component="label" color="tertiary">
                About
              </Button>
              <Button sx={{fontSize: 18}} component="label" color="tertiary">
                Experience
              </Button>
              <Button sx={{fontSize: 18}} component="label" color="tertiary">
                Work
              </Button>
              <Button sx={{fontSize: 18}} component="label" color="tertiary">
                Contact
              </Button>
            </Box>
          </Toolbar>
        </AppBar>
        <Box
          sx={{mt: 0.5, background: '#EDBEA4', height: '100vh', width: '100%'}}
          style={styles.paperContainer}
        >
          <Box
            display="flex"
            justifyContent="center"
            alignItems="center"
            flex={1}
          >
            <Stack
              spacing={4}
              display="flex"
              justifyContent="center"
              alignItems="center"
              flex={1}
            >
              <IconButton size='large' flex={0} sx={{mt: 1}}>
                <ExpandMoreIcon fontSize="large" sx={{color: 'white'}}/>
              </IconButton>
              <Typography variant='h2' color='tertiary.main'
                sx={{textShadow: '1px 0px 1px grey'}}
              >
                William Santosa
              </Typography>
              <Typography variant='h5' color='tertiary.main'
                sx={{textShadow: '1px 0px 1px grey'}}
              >
                Computer Science | Database Systems | Software Engineer
              </Typography>
              <Stack direction='row'>
                <Button href="https://github.com/williamsantosa">
                  <GitHubIcon sx={{color: 'white'}}
                  />
                </Button>
                <Button href="https://www.linkedin.com/in/williamsantosa/">
                  <LinkedInIcon sx={{color: 'white'}}/>
                </Button>
                <Button href="mailto:williamwsantosa@gmail.com">
                  <EmailIcon sx={{color: 'white'}}/>
                </Button>
              </Stack>
            </Stack>
          </Box>
        </Box>
        <Box/>
        <Stack
          spacing={4}
          display="flex"
          justifyContent="center"
          alignItems="center"
          flex={1}
        >
          <Box sx={{
            mt: 4, ml: '1%',
            padding: 3,
            width: '80%', height: '300px',
          }}
          >
            <Box sx={{ml: 5}}/>
            <Stack direction='row' spacing={4}>
              <img src={image} alt="Will's Face"
                width='250' height='250'
                className='roundedImage'
              />
              <Stack spacing={2}>
                <Box/>
                <Typography variant='h4' color="tertiary.main">
                  Hey! I'm William Santosa.
                </Typography>
                <Typography variant='h6' color="tertiary.main">
                  I'm an engineer aiming to change the world through my work.
                  Currently, I am looking to work on databases in graduate 
                  school and am pursuing a B.S in CS at UC Santa Cruz.
                </Typography>
              </Stack>
            </Stack>
          </Box>
          <Stack direction='row'>
            <Box
              sx={{
                ml: 4, mr: 4,
                bgcolor: 'quaternary.main',
                width: '70%', height: '300px',
              }}
              className='rounded'
            >
              <Typography variant='h4' color='tertiary.main'>
                About Me
              </Typography>
            </Box>
            <Box
              sx={{
                ml: 4, mr: 4,
                bgcolor: 'quaternary.main',
                width: '20%', height: '300px',
              }}
              className='rounded'
            >
              <Typography variant='h4' color='tertiary.main'>
                About Me
              </Typography>
            </Box>
          </Stack>
        </Stack>
        <Box sx={{mb: 500}}></Box>
      </ThemeProvider>
    </>
  );
}

export default App;
